{"operationName":"getPressReleases","variables":{"site":"english","limit":20,"offset":20,"date":["and",">= 20$_5-01-01T00:00:00","< 20$_5-01-01T00:00:00"],"relatedTo":null},"query":"query getPressReleases($site: [String], $date: [QueryArgument], $relatedTo: [QueryArgument], $search: String, $limit: Int, $offset: Int) {
  pressReleases: entries(site: $site, section: "pressReleases", pressReleaseDate: $date, relatedTo: $relatedTo, search: $search, limit: $limit, offset: $offset, orderBy: "pressReleaseDate desc") {
    uri
    ... on pressReleases_pressReleases_Entry {
      title: pressReleaseTitle
      date: pressReleaseDate @formatDateTime(timezone: "Europe/Brussels")
      categories: pressReleaseCategories {
        title
        __typename
      }
      __typename
    }
    __typename
  }
  latestPressReleases: entries(site: $site, section: "pressReleases", pressReleaseDate: $date, relatedTo: $relatedTo, search: $search, limit: $limit, offset: $offset, orderBy: "pressReleaseDate desc") {
    uri
    ... on pressReleases_pressReleases_Entry {
      title: pressReleaseTitle
      date: pressReleaseDate @formatDateTime(timezone: "Europe/Brussels")
      categories: pressReleaseCategories {
        title
        __typename
      }
      __typename
    }
    __typename
  }
  totalPressReleases: entryCount(site: $site, section: "pressReleases", pressReleaseDate: $date, relatedTo: $relatedTo, search: $search, orderBy: "pressReleaseDate desc")
}
"}
